import React from 'react';
import { allpost, isAuthenciate } from '../auth/index';

class Home extends React.Component {

    constructor() {
        super();
        this.state = {
            post: []
        }
    }

    componentDidMount() {
        const token = isAuthenciate().token;
        allpost(token)
        .then(data => {
            if(data.error) {
                console.log(data.error);
            }else {
                this.setState({ post: data });
            }
        })              
    }

    render() {
        return (
            <div>
                <div className="jumbotron">
                    <h1>Post</h1>
                </div>
            </div>
        );
    }
}

export default Home;
